import Vue from "vue";
import Component from "vue-class-component";
import { isValid } from "../../utils/FuncHelpers";

@Component({})
export default class Breadcrumb extends Vue {
		get breadcrumbs() {
				const metas: any[] = [];
				this.$route.matched.map((item: any) => {
						if (
								isValid(item) &&
								isValid(item.meta) &&
								isValid(item.meta.breadcrumb)
						) {
								metas.push(item);
						}
				});
				return metas;
		}
}
